// CELL Struct

typedef union type_union
{
	char operador;
	int number;
}elemento;

typedef struct CELL
{
    elemento type;
    char id;
    char memory;
    struct CELL* left;
    struct CELL* right;
}CELL;

typedef struct pilha
{
	int cabeca_pilha;
	int tamanho;
	CELL** celulas;
}Pilha;

// Global var to indicate redutible
int redutible = 0;
CELL heap[HEAP_SIZE];
int lastPos = 0;

/// Functions
CELL* create_CELL();
CELL* create_CELL_parenthesis(CELL* esq, CELL* dir);
CELL* create_CELL_leaf(char type);
int searchParenthesis(int initPos);
CELL* create_graph(int i, int j);
void print_graph(CELL* inicio);
Pilha* create_pilha();
void pilha_insere(Pilha *p, CELL* celula);
CELL* get_topo_pilha(Pilha* p);
int is_Pilha_Vazia(Pilha* p);
void pilha_remove(Pilha* p);
void free_pilha(Pilha* p);


